const SERVER_ROUTE = {
  ACCOUNT: () => "/api/account/",
  SUMMONER: () => "/api/summoner?puuid=${}",
  MATCH_HISTORY: () => "/api/match-history/",
  MATCH: () => "/api/atch/",
};

module.exports = { SERVER_ROUTE };
